    p_room_number, 
    p_pax, 
    p_names, 
    p_restaurant_id, 
    p_desired_date,
    p_time, 
    p_company_id, 
    p_hotel_id, 
    p_created_by, 
    p_currencies_id,
    p_price,
    p_total_ammount,
    p_exchange_rate,
    p_paid
);

SET @last_id = LAST_INSERT_ID();
SET @sha = SHA2(@last_id,256);
UPDATE reservations
    SET qrcode = @sha
    WHERE reservations_id = @last_id;
SELECT @sha as result;

SELECT 1;
END ;;
